import Grid from "@mui/material/Grid";
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";
import FormField from "layouts/pages/account/components/FormField";
// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
// import Footer from "examples/Footer";
import Card from "@mui/material/Card";
import 'bootstrap/dist/css/bootstrap.min.css';
import SuiButton from "components/SuiButton";
// import { Link } from "react-router-dom";
import DataTable from "examples/Tables/DataTable";
import Checkbox from "@mui/material/Checkbox";
import { useState } from "react";
import SuiDatePicker from "components/SuiDatePicker";
import PropTypes from "prop-types";
import transactiontable from "layouts/authentication/error/transactiontable";

function IdCell({ id, checked }) {

  IdCell.defaultProps = {
    checked: false,
  };

  // Typechecking props for the IdCell
  IdCell.propTypes = {
    id: PropTypes.string.isRequired,
    checked: PropTypes.bool,
  };

  const [startDate, setStartDate] = useState(new Date());
  const [endDate, setEndDate] = useState(new Date());


  const handleSetStartDate = (newDate) => setStartDate(newDate);
  const handleSetEndDate = (newDate) => setEndDate(newDate);

  const passwordRequirements = [

  ];

  const renderPasswordRequirements = passwordRequirements.map((item, key) => {
    const itemKey = `element-${key}`;

    return (

      <SuiBox key={itemKey} component="li" color="text" fontSize="1.25rem" lineHeight={1}>
        <SuiTypography
          variant="button"
          textColor="text"
          fontWeight="regular"
          verticalAlign="middle"
        >
          {item}
        </SuiTypography>
      </SuiBox>
    );
  });

  return (

    <DashboardLayout>
      <DashboardNavbar />
      <SuiBox p={2} >
        <Card id="profile">
          <SuiBox p={3} style={{ backgroundColor: "#abebc6" }}>
            <Grid container spacing={3} alignItems="center">
              <Grid item>
                <SuiBox height="100%" mt={0.5} lineHeight={1}>
                  <SuiTypography variant="h3" fontWeight="medium" style={{ color: "black" }}>
                    Transaction
                  </SuiTypography>
                </SuiBox>
              </Grid>
            </Grid>
          </SuiBox>
        </Card>
      </SuiBox>

      <SuiBox p={2}>
        <Card id="change-password">

          <SuiBox display="flex" justifyContent="space-between" alignItems="flex-end" flexWrap="wrap">
            <SuiBox component="ul" m={0} pl={3.25} mb={{ xs: 8, sm: 0 }}>
              {renderPasswordRequirements}
            </SuiBox>

          </SuiBox>

          <SuiBox component="form" pb={3} px={3} p={3} style={{ backgroundColor: "pink" }}>

            <Grid container spacing={3}>
              <Grid item xs={12} >
                <Grid container spacing={2}>

                  <Grid item xs={12} sm={15}>
                    <Grid container spacing={3}>

                      <Grid item xs={12} sm={4} style={{ color: "black" }}>
                        <FormField type="text" label="Name/Email/Number/User Id" defaultValue="71283476591"  />
                      </Grid>

                      <Grid item xs={12} sm={4}>
                        <FormField type="text" label=" Advisor" defaultValue="71283476591"  />
                      </Grid>

                      <Grid item xs={12} sm={4}>
                        <SuiBox
                          display="flex"
                          flexDirection="column"
                          justifyContent="flex-end"
                          height="100%"
                        >
                          <SuiBox mb={1} ml={0.5} mt={3} lineHeight={0} display="inline-block">
                            <SuiTypography component="label" variant="caption" fontWeight="bold" style={{ color: "black" }}>
                              Start Date
                            </SuiTypography>
                          </SuiBox>
                          <SuiDatePicker value={startDate} onChange={handleSetStartDate} />
                        </SuiBox>
                      </Grid>

                    </Grid>

                  </Grid>

                  <Grid item xs={12} sm={15}>
                    <Grid container spacing={3} >

                      <Grid item xs={12} sm={4}>
                        <SuiBox
                          display="flex"
                          flexDirection="column"
                          justifyContent="flex-end"
                          height="100%"
                        >
                          <SuiBox mb={1} ml={0.5} mt={3} lineHeight={0} display="inline-block">
                            <SuiTypography component="label" variant="caption" fontWeight="bold" style={{ color: "black" }}>
                              End Date
                            </SuiTypography>
                          </SuiBox>
                          <SuiDatePicker value={endDate} onChange={handleSetEndDate} />
                        </SuiBox>
                      </Grid>

                      <Grid item xs={12} sm={4}>
                        <SuiBox display="flex" alignItems="center" style={{ marginTop: "50px" }}>

                          <Checkbox defaultChecked={checked} />
                          <SuiBox ml={1}>
                            <SuiTypography variant="caption" fontWeight="medium" textColor="text" >
                              {id}
                            </SuiTypography>
                          </SuiBox>

                          <SuiTypography component="label" variant="h10" fontWeight="bold" style={{ color: "black" }}>
                            Download Excel
                          </SuiTypography>
                        </SuiBox>
                      </Grid>

                      <Grid item xs={12} sm={4}>
                        <SuiBox
                          display="flex"
                          flexDirection="column"
                          justifyContent="flex-end"
                          height="100%"
                        >
                          <SuiButton variant="gradient" buttonColor="dark" >
                            Submit
                          </SuiButton>
                        </SuiBox>
                      </Grid>

                    </Grid>
                  </Grid>

                </Grid>
              </Grid>
            </Grid>
          </SuiBox>
        </Card>

      </SuiBox>

      <SuiBox p={2}>
        <Card id="change-password">
          <SuiBox p={3}>
            <DataTable table={transactiontable} entriesPerPage={false} canSearch />
          </SuiBox>
        </Card>
      </SuiBox>
    </DashboardLayout>
  );
}

export default IdCell;
